import logo from './logo.svg';
import './App.css';
import {Component} from "react";

class App extends Component{

  state = {
    name: 'Clément GEYER'
  }

  render(){
    return (
        <div className="App">
          <h1>{this.state.name}</h1>
        </div>
    );
  }

}

export default App;
